// src/pages/Dashboard.jsx
import { useEffect, useState } from "react";
import "./Dashboard.css";
import { Line } from "react-chartjs-2";
import {
  Chart as ChartJS,
  LineElement,
  CategoryScale,
  LinearScale,
  PointElement,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(LineElement, CategoryScale, LinearScale, PointElement, Tooltip, Legend);

export default function Dashboard() {
  const [sensorData, setSensorData] = useState({
    tds: 0,
    ph: 0,
    tempAir: 0,
    tempUdara: 0,
    humidity: 0,
    timestamp: new Date().toISOString(),
  });

  const [selectedParam, setSelectedParam] = useState("ph");
  const [history, setHistory] = useState({ ph: [], tds: [], tempAir: [], tempUdara: [], humidity: [], labels: [] });

  useEffect(() => {
    const interval = setInterval(() => {
      fetch("http://localhost:5000/api/data")
        .then((res) => res.json())
        .then((data) => {
          setSensorData(data);
          setHistory((prev) => ({
            ...prev,
            ph: [...prev.ph.slice(-9), data.ph],
            tds: [...prev.tds.slice(-9), data.tds],
            tempAir: [...prev.tempAir.slice(-9), data.tempAir],
            tempUdara: [...prev.tempUdara.slice(-9), data.tempUdara],
            humidity: [...prev.humidity.slice(-9), data.humidity],
            labels: [...prev.labels.slice(-9), new Date(data.timestamp).toLocaleTimeString()],
          }));
        });
    }, 5000);
    return () => clearInterval(interval);
  }, []);

  const handleCardClick = (param) => {
    setSelectedParam(param);
  };

  const chartData = {
    labels: history.labels,
    datasets: [
      {
        label: selectedParam,
        data: history[selectedParam],
        fill: false,
        borderColor: "#4ade80",
        backgroundColor: "#4ade80",
        tension: 0.4,
      },
    ],
  };

  const handleControl = (type) => {
    fetch("http://localhost:5000/api/control", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ action: type })
    })
        .then(res => res.json())
        .then(data => {
        console.log("Respon kontrol:", data);
        alert(`Berhasil mengirim perintah untuk ${type}`);
        })
        .catch(err => {
        console.error("Gagal mengirim kontrol:", err);
        alert("Terjadi kesalahan saat mengirim kontrol.");
        });
    };

  return (
    <div className="dashboard">
      <h1 className="dashboard-title">Swásêma Dashboard</h1>
      <p className="timestamp">{new Date(sensorData.timestamp).toLocaleString()}</p>

      <div className="sensor-grid">
        <div
          className={`sensor-card ${selectedParam === "ph" ? "active" : ""}`}
          onClick={() => handleCardClick("ph")}
        >
          <h2>pH Air</h2>
          <p>{sensorData.ph}</p>
        </div>
        <div
          className={`sensor-card ${selectedParam === "tds" ? "active" : ""}`}
          onClick={() => handleCardClick("tds")}
        >
          <h2>TDS</h2>
          <p>{sensorData.tds} ppm</p>
        </div>
        <div
          className={`sensor-card ${selectedParam === "tempAir" ? "active" : ""}`}
          onClick={() => handleCardClick("tempAir")}
        >
          <h2>Suhu Air</h2>
          <p>{sensorData.tempAir} °C</p>
        </div>
        <div
          className={`sensor-card ${selectedParam === "tempUdara" ? "active" : ""}`}
          onClick={() => handleCardClick("tempUdara")}
        >
          <h2>Temp Udara</h2>
          <p>{sensorData.tempUdara} °C</p>
        </div>
        <div
          className={`sensor-card ${selectedParam === "humidity" ? "active" : ""}`}
          onClick={() => handleCardClick("humidity")}
        >
          <h2>Kelembapan</h2>
          <p>{sensorData.humidity} %</p>
        </div>
      </div>

      <div className="panel">
        <Line data={chartData} />
      </div>
      <div className="panel">
        <h2>Kontrol Nutrisi dan pH</h2>
        <div className="control-buttons">
            <button onClick={() => handleControl("nutrientA")}>Tambahkan Nutrien A</button>
            <button onClick={() => handleControl("nutrientB")}>Tambahkan Nutrien B</button>
            <button onClick={() => handleControl("phUp")}>Tambahkan pH Up</button>
            <button onClick={() => handleControl("phDown")}>Tambahkan pH Down</button>
        </div>
    </div>
    </div>
  );
}
